function GetMap()

	local MapToConvert = {}
	
	-- very basic upscaling

	local SmallMap = GetSmallMap()
	local sX, sY = 0, 0
	local lX, lY = 0, 0
	
	for x = 0, g_iW, 1 do
		MapToConvert[x] = {}
		for y = 0, g_iH, 1 do
			print (x, y, sX, sY, lX, lY)
			MapToConvert[x][y] = SmallMap[sX][sY]
			lY = lY + 1
			if lY == 5 then
				lY = 0
			else
				sY = sY +1
			end
		end
		sY = 0
		lX = lX + 1
		if lX == 4 then
			lX = 0
		else
			sX = sX +1
		end
	end

	return MapToConvert
end

